<section style=""background-color: #f5f5f5;"" class=""m-inner-sec"">
    <div class=""container-fluid"">
        <div class=""title-rw"">
            <h2 class=""title"">Book Your Cylinder while sitting at home</h2>
            <div class=""title-line""></div>
        </div>
        <div class=""paragraph"">
            <p>
                Imagine you are going to make your favorite dish and suddenly you know that your Gas Cylinder is empty and you need a new cylinder. What will you do in such times?  Booking gas by going offline to your gas cylinder provider and then fetching the gas or waiting for the gas to arrive for weeks, isn't a very tedious task. But we have a piece of very good news for you.  Now you do not need to go out of the house to book a cylinder in case of exhaustion of the gas cylinder. We have also made available the option of gas booking on ");
            WriteLiteral(@"the platform. This means now You can easily book your cylinder within a few minutes through rechargeZap sitting at your home.
            </p>
        </div>
    </div>
</section>
<!-- Section End-->
<!-- Section Start-->
<section class=""m-inner-sec"">
    <div class=""container-fluid"">
        <div class=""title-rw"">
            <h2 class=""title"">Let's not make cylinder booking more complicated</h2>
            <div class=""title-line""></div>
        </div>
        <div class=""paragraph"">

            <p>
                Booking a cylinder by physically going to your gas cylinder provider and standing in a long line is indeed a very complicated and utterly tiring task. To solve this problem of yours, we have made available the option of cylinder booking on rechargeZap.  With the help of this, now you do not have to wait in line to book gas. Whenever you need you can book your gas cylinder just by going on the rechargeZap platform and tapping on the cylinder option. All you need to do is Choose yo");
            WriteLiteral(@"ur Gas agency name and put your agency's registered mobile number.
            </p>
            <p>Here is the list of gas agency provider names that rechargeZap supports</p>
            <ul>
                <li>	BPCL (Bharat gas booking)</li>
                <li>	HP has booking</li>
                <li>	Indane gas booking ( Indian Oil)</li>
            </ul>
        </div>
    </div>
</section>
<!-- Section End-->
